import React from 'react'
import arrow from '../img/buttons/arrowIcon.png'

export const ArrowButton = (props) => {

  const onClick = function(){
    props.setNewItem(false);
    props.setClickItem(false);
  }
  return (
    <button className='arrowButton btn' onClick={onClick}>
        <img src={arrow} alt='arrow Icon'/>
    </button>
  )
}
